import axios from 'axios';
import React, { useState, useEffect } from 'react';


function UserHistory() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
      axios.get("http://localhost:3001/userHistory")
      .then(response=>{
        console.log(response.data)
        setData(response.data)
        if(response.data.Heredity===1){
          response.data.Heredity=""
        }
      })
      .catch(error=>{
        console.error("Error",error)
      })
  };

  return (
    <div>
      <h1>Data from MongoDB</h1>
      <table>
        <thead>
          <tr>
            <th>Heredity</th>
            <th>Physical Activity</th>
            <th>Fast Food</th>
            <th>Glucose</th>
            <th>Blood Pressure</th>
            <th>BMI</th>
            <th>Age</th>
            <th>Outcome</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.Heredity}</td>
              <td>{item.PhysicalActivity}</td>
              <td>{item.FastFood}</td>
              <td>{item.Glucose}</td>
              <td>{item.BloodPressure}</td>
              <td>{item.BMI}</td>
              <td>{item.Age}</td>
              <td>{item.Outcome}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default UserHistory;
